import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({ row }) {
    return (
        <Grid>
            {row.map((item) => {
                return (
                    <Grid item xs={1.33}>
                        {item}
                    </Grid>
                )
            })}
        </Grid>
    )
}
const Ticket = ({ ticket }) => {
    return (
        <Grid container spacing={3}>
            <h1>{ticket}</h1>
            {ticket}
        </Grid>
    )
}
export default Ticket;
